import User from "./User"

const Users =( { users } )=> {

    const userComponents = users.map(userd => {
        return <User 
                    key={userd.user_id}
                    lastName={userd.lName}
                    firstName={userd.fName}
                    username={userd.username}
                    email={userd.email}
                    dateCreated={userd.date_created}
                />
    })

    return(
        <main className="main" id="usersMain">
            <div className="container mt-5 users-con">
                <h2 className="display-3 text-capitalize user-h2">users</h2>
                <div className="row">
                    { userComponents }
                </div>
            </div>
        </main>
    )
}

export default Users
